var ImageBorderMode = {
  CLAMP: 0,
  REPEAT: 1,
  MIRROR: 2
};
var InterpolationMode = {
  NEAREST: 0,
  LINEAR: 1,
  CUBIC: 2
};
var Constants = {
  ImageBorderMode: ImageBorderMode,
  InterpolationMode: InterpolationMode
};

export { ImageBorderMode, InterpolationMode, Constants as default };
